import React from 'react';
import { Card } from 'react-bootstrap';
import './Style.css';
import selfPicture from './../img/selfPicture.png';
import { FaFacebook, FaLinkedin } from 'react-icons/fa';

function PictureContainer() {

    return (
        <Card id="picture_container" style={{backgroundColor: "lightblue"}}>
          <Card.Img variant="top" src={selfPicture} />
          <Card.Title>Andrea Pallotta</Card.Title>
          <Card.Subtitle>
            3rd Year Student at Rochester Institute of Technology
          </Card.Subtitle>
          <Card.Text>
            <Card.Link href="#"><FaFacebook></FaFacebook></Card.Link>
            <Card.Link href="#"><FaLinkedin></FaLinkedin></Card.Link>
          </Card.Text>
        </Card>
      );
}

export default PictureContainer;
